{"post_stream":{"posts":[{"id":3333630,"name":"Burak-Talha","username":"okcu73","avatar_template":"/user_avatar/www.chiefdelphi.com/okcu73/{size}/260671_2.png","created_at":"2024-03-15T08:14:35.477Z","cooked":"<p>Hello to everyone!<br>
I have been running the path planner application in simulation for a while and getting good results. Until I started doing the calculations myself :(.<br>
When I called the getWheelSpeeds() method with the encoder.getRate() method I got from the encoder, I saw that everything worked very well, but I need to implement the scenario mentioned in .getRate() on my own robot and unfortunately Spark Max does not have such a method. Here is the calculations I used in the code :</p>
<pre><code class="lang-auto">  public DifferentialDriveWheelSpeeds getWheelSpeeds(){
    // Main calculations
    double elapsedTime = Timer.getFPGATimestamp() - previousTime;
    double currentLeftTick = ((m_leftEncoder.getDistance()-previousLeftValue) / elapsedTime);
    double currentRightTick = ((m_rightEncoder.getDistance()-previousRightValue) / elapsedTime);

    // Checkout values
    SmartDashboard.putNumber("CURRENT LEFT TICK:",currentLeftTick);
    SmartDashboard.putNumber("CURRENT RIGHT TICK:",currentRightTick);
    SmartDashboard.putNumber("ENCODER RIGHT RATE:",m_rightEncoder.getRate());
    SmartDashboard.putNumber("ENCODER LEFT RATE:",m_leftEncoder.getRate());

    // Checkout values accuracy
    boolean isLeftTrue = 0.5 &gt; Math.abs(currentLeftTick-m_leftEncoder.getRate());
    boolean isRightTrue = 0.5 &gt; Math.abs(currentRightTick-m_rightEncoder.getRate());
    SmartDashboard.putBoolean("RIGHT SIDE TICK RATE:", isRightTrue);
    SmartDashboard.putBoolean("LEFT SIDE TICK RATE:", isLeftTrue);

    // Passing old values
    previousLeftValue = m_leftEncoder.getDistance();
    previousRightValue = m_rightEncoder.getDistance();
    previousTime = Timer.getFPGATimestamp();

    // DEBUG: The values I calculate are reset when using autonomously (Also working in the tele-op)
    System.out.print("CURRENT LEFT TICK:"+currentLeftTick);
    System.out.println("CURRENT RIGHT TICK:"+currentRightTick);
    return new DifferentialDriveWheelSpeeds(0, 0);
  }
</code></pre>
